import TourData from "./tourdata";

import './Tourhome.css'

const Tourhome = () => {
    return (
        <>
           <div className="tourtitle">

        <span>JODHPUR TOURISM</span>
        <span>HIRE CARS FOR POPULAR DESTINATION OF JODHPUR
</span>
           </div>
<div className="courtour">

                    <Swiper
                        spaceBetween={30}
                        centeredSlides={true}
