                    </Swiper>
                    <Swiper
                        spaceBetween={30}
                        centeredSlides={true}
                        autoplay={{
                            delay: 2500,
                            disableOnInteraction: false,
                        }}
                       
                        modules={[Autoplay]}
                        className="mySwiper"
                    >
                        <SwiperSlide><img src={Images1} alt="image" /></SwiperSlide>
                        <SwiperSlide><img src={image2} alt="" /></SwiperSlide>
                       
                    </Swiper>
                    </div>
              
        </>
    )
}

export default Tourhome
